import React, { Component } from "react";

import Noticias from './/Noticias';
import formLogin from './FormLogin';

class Login extends Component {
    render() {
        return (
            <div>
                <div className="container">
                    <Noticias></Noticias>
                    <formLogin></formLogin>
                </div>


            </div>
        )
    };

}

export default Login;
